import React from 'react';
import Products from '../Products';
import Courses from '../Courses';
import AddCourse from '../Courses/AddCourse';
import AddProduct from '../Products/AddProduct';
const routes = [
	{
		path: '/',
		exact: true,
		component: () => {
			return (
				<>
					<Products products={productItems} />
					<Courses courses={courseItems} />
				</>
			);
		},
	},
	{
		path: '/course',
		component: () => <Courses courses={courseItems} />,
	},
	{
		path: '/product',
		component: () => <Products products={productItems} />,
	},
	{
		path: '/course/add',
		exact: true,
		component: () => <AddCourse item={addCourse} />,
	},
	{
		path: '/product/add',
		component: () => <AddProduct item={addProduct} />,
	},
];

export default routes;
